Estimate Considerations Related to Macroeconomic Conditions and other Geopolitical Conditions Due to recent disruptions in access to bank deposits and lending commitments associated with bank failures, macroeconomic and geopolitical conditions, there has been uncertainty and disruption in the global economy and financial markets. We are not aware of any specific event or circumstance that would require an update to our estimates or judgments or a revision of the carrying value of its assets or liabilities as of December 31, 2023. While there was no material impact to our condensed consolidated financial statements as of and for the three and six months ended December 31, 2023, these estimates may change, as new events occur and additional information is obtained, which could materially impact our condensed consolidated financial statements in future reporting periods.
